import React, { useState, useEffect } from "react";
// import userContext from "./UserContext";
import ShareBnBApi from "./api";
import ListingCard from "./ListingCard";

/**Shows homepage
 *
 * useContext= user
 * props=none
 * state=none
 *
 * Routes --> Homepage
 */

function Homepage() {
  console.log("homepage");
  const [user, setUser] = useState({
    date: null,
  })
  const [listings, setListings] = useState({
    data: null,
    isLoading: true,
  });

  useEffect(function getGuestOnMoung(){
    console.log("getGuestOnMount")
    async function getGuestToken() {
      const response = await ShareBnBApi.is_guest();
      setUser({data: response})
    }
    getGuestToken();
  }, [])

  useEffect(function getListingsOnMount() {
    console.log("getListingsOnMount");
    async function fetchListings() {
      const response = await ShareBnBApi.getListingsForGuest();
      setListings({ data: response, isLoading: false });
    }
    fetchListings();
  }, []);

  if(listings.isLoading === true) {
    return <p>Loading...</p>
  }
  console.log("user?", user.data)

  return (
    <div className="Homepage">
      {listings.data.map((listing) => (
        <ListingCard key={listing.id} listing={listing} />
      ))}
    </div>
  );
}

export default Homepage;
